import logo from './logo.svg';
import './App.css'; 
import React from 'react';
import ControlCard from './Components/ControlCard'

 export default function App() {
  const titleArray = ['Logistic', 'E-Commerce', 'Banking'];
  return (
    <div>     
      <></> 
        <div className="mt-4"> {/* Adds margin-top to create space below the Topbar */}
          {titleArray.map(eachTitle => (
              <div className="ms-3 mb-3" key={eachTitle}> {/* ms-3 for left margin, mb-3 for bottom margin for each card */}
                  <ControlCard title={eachTitle} />
              </div>
          ))}
        </div>
    </div>
);
}

 
